      "date": "1731-01-02",
      "tags_section": "Personen fo Diene offeriren:",
      "text": "1. Ein junger Mensch, 24 Jahr alt, von guter Statur / wegen Dienft Conditions hält in Augspurg / nach Stellen, offeriret fich zum Dienfte bey einem mittelmäßigen Cavalier, als Stalljungen, und ist erfahren, wird in allen andern Cavalièr Dienften zu Dienften zu verlangen. Tritt Dienften an bey Herrn Salomon Benjamin, bey dem Jüd. Bäcken, auf dem Korn=Marckt, bey daß Juden Portl, auf der Prob zu fenden, und bitt Dienfte=Suchende, um beftirmet/ und vor nicht debft verden jottes/ Kinderg aufzunehmen, ferner bittet er um Gottes Segen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Personen fo Diene offeriren:",
      "text": "2. Ein ehrlicher, treuer und fleißiger Diener, welcher bey einem Cavalier fieben Jahr / und zwar in der Stelle eines Bedientens, gedienet, offeriret fich zum Dienften bey einem Cavalier, der in Erlernung der teutschen, frantzösischen und andern Sprachen, mit Reißen, Füttern, Pferde zäumen, und andern Cavalièr Dienften erfahren, hat gute Condition, und begehret fich bey dießmaligem Michaelis zu verdingen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Personen fo Diene offeriren:",
      "text": "3. Der lang Bäcker Georg Lantzmair, meldet vor gegenwärtiger Zeit eine Dienftin, 22 Jahr alt, Accommodei und Außbürftung, fo wohl unter als über Cavalièren, auch bey Bäcker=Leuten, Bedientens und Dünnefcihern, fo auch bey der Handlung und in der Wein=Schenke zu Dienften, fie ist fafferlich, reinlich, und in allen Cavalièr Dienften erfahren, bietet gute Conduit, und will fich bey dießmaligem Michaelis Dienften begeben."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Nachdem die zum Deel und Theils Aufhebung",
      "text": "Die Unterfchriebene, als bifhero bey dießiger Feftung und gegend wohnhafft, und bey dero gnädigen Herrfchafften in Dienften gewefen, indem aber bey gegenwärtiger Zeit die Unterfchriebene bey dero gnädigen Herrfchafften in keinen Dienften mehr nothwendig, alßo fie unterthänigft bitten, ob fie bey ein und andern gnädigen Herrfchafften in Dienften zu gelangen vermöchten, wie fie fich denn alßo unterthänigft zu empfehlen haben, und zu Dienften, wo fie begehret, fich anbieten wollen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Wenige Stunde Nachdruckfchriften:",
      "text": "Täglich lieffern wir nach folgenden, und besonders gutem Preis: 1. Der Neu=eingerichtete Geistliche Schatz, darinnen nicht allein die nothwendigen geistlichen Exercitien, alß Gebet, Beicht, Communion, und andere geistliche Ubungen, sondern auch die nohtwendigen geistlichen Ermahnungen und Unterrichtungen enthalten, die gemeinen Christen zu ihrer Seelen Seeligkeit in dieser Welt, und zum ewigen Leben."
    }
  ]
}
